sys_variable_value.value:
(function execute(inputs, outputs) {
    var baseUrl = "https://cpcallwfdemo.service-now.com";
    var sysId = inputs.sysid;         // Your Flow input variable for Sys ID
    var number = inputs.number;        // Your Flow input variable for incident number

    var link = '<a href="' + baseUrl + '/now/cwf/agent/record/x_snc_ai_agents_0_fso_sma_onboarding/' + sysId + '">' + number + '</a>';
    outputs.html_link = link;
})(inputs, outputs);

